import './Navigation.css';

function Navigation(props) {

    return(
        <nav>
            <div className='option'>
                <div className='nav-link' onClick={() => props.setSiteNumber(1)}>Family Signup</div>
                <div className='nav-link' onClick={() => props.setSiteNumber(2)}>Site 2</div>
                <div className='nav-link' onClick={() => props.setSiteNumber(3)}>Site 3</div>
            </div>
        </nav>
    )
}

export default Navigation;
